#
# TABLE STRUCTURE FOR: Users_skills
#
USE prteam;
DROP TABLE IF EXISTS `Users_skills`;

CREATE TABLE `Users_skills` (
  `user_id` int(10) NOT NULL,
  `skill_id` int(10) NOT NULL,
  `start_data` timestamp NULL DEFAULT NULL,
  `finish_data` timestamp NULL DEFAULT NULL,
  KEY `user_skills_users_fk` (`user_id`),
  KEY `user_skills_skills_fk` (`skill_id`),
  CONSTRAINT `user_skills_skills_fk` FOREIGN KEY (`skill_id`) REFERENCES `skills` (`id`),
  CONSTRAINT `user_skills_users_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: contract_statuses
#

DROP TABLE IF EXISTS `contract_statuses`;

CREATE TABLE `contract_statuses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: contracts
#

DROP TABLE IF EXISTS `contracts`;

CREATE TABLE `contracts` (
  `owner_id` int(11) NOT NULL,
  `employee_id` int(11) NOT NULL,
  `status_id` int(10) unsigned NOT NULL,
  `requested_at` datetime DEFAULT current_timestamp(),
  `confirmed_at` datetime DEFAULT NULL,
  KEY `contracts_owner_fk` (`owner_id`),
  KEY `contracts_users_fk` (`employee_id`),
  KEY `contracts_contract_statuses_fk` (`status_id`),
  CONSTRAINT `contracts_contract_statuses_fk` FOREIGN KEY (`status_id`) REFERENCES `contract_statuses` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `contracts_owner_fk` FOREIGN KEY (`owner_id`) REFERENCES `owner_statuses` (`id`),
  CONSTRAINT `contracts_users_fk` FOREIGN KEY (`employee_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `from_user_id` int(10) NOT NULL,
  `to_user_id` int(10) NOT NULL,
  `body` text COLLATE utf8_unicode_ci NOT NULL,
  `is_important` tinyint(1) DEFAULT NULL,
  `is_delivered` tinyint(1) DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `messages_from_users_fk` (`from_user_id`),
  KEY `messages_to_users_fk` (`to_user_id`),
  CONSTRAINT `messages_from_users_fk` FOREIGN KEY (`from_user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `messages_to_users_fk` FOREIGN KEY (`to_user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: owner_statuses
#

DROP TABLE IF EXISTS `owner_statuses`;

CREATE TABLE `owner_statuses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `describes` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: photos
#

DROP TABLE IF EXISTS `photos`;

CREATE TABLE `photos` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `filename` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: profiles
#


DROP TABLE IF EXISTS profiles;
CREATE TABLE profiles (
  user_id int NOT NULL,
  sex char(1) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  birthday date DEFAULT NULL,
  hometown varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  photo_id int(10) UNSIGNED DEFAULT NULL,
  team_id INT UNSIGNED DEFAULT NULL,
  CONSTRAINT profiles__users_fk
 	 FOREIGN KEY (user_id)  REFERENCES users (id) ON DELETE CASCADE,
  CONSTRAINT profiles_photos_fk
 	 FOREIGN KEY (photo_id)  REFERENCES photos (id) ON DELETE SET NULL  
    );



#
# TABLE STRUCTURE FOR: projects
#

DROP TABLE IF EXISTS `projects`;

CREATE TABLE `projects` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `describes` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `owner_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `projects_owners_fk` (`owner_id`),
  CONSTRAINT `projects_owners_fk` FOREIGN KEY (`owner_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: projects_tasks
#

DROP TABLE IF EXISTS `projects_tasks`;

CREATE TABLE `projects_tasks` (
  `prjct_id` int(10) NOT NULL,
  `tsk_id` int(10) NOT NULL,
  `user_id` int(10) NOT NULL,
  `start_data` timestamp NULL DEFAULT NULL,
  `finish_data` timestamp NULL DEFAULT NULL,
  `deadline` timestamp NULL DEFAULT NULL,
  KEY `projects_tasks_projects_fk` (`prjct_id`),
  KEY `projects_tasks_tasks_fk` (`tsk_id`),
  KEY `projects_tasks_users_fk` (`user_id`),
  CONSTRAINT `projects_tasks_projects_fk` FOREIGN KEY (`prjct_id`) REFERENCES `projects` (`id`),
  CONSTRAINT `projects_tasks_tasks_fk` FOREIGN KEY (`tsk_id`) REFERENCES `tasks` (`id`),
  CONSTRAINT `projects_tasks_users_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: skills
#

DROP TABLE IF EXISTS `skills`;

CREATE TABLE `skills` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `describes` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: tasks
#

DROP TABLE IF EXISTS `tasks`;

CREATE TABLE `tasks` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `describes` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: tasks_requests
#

DROP TABLE IF EXISTS `tasks_requests`;

CREATE TABLE `tasks_requests` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `tsk_id` int(10) NOT NULL,
  `skill_id` int(10) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `tasks_requests_tasks_fk` (`tsk_id`),
  KEY `tasks_requests_skills_fk` (`skill_id`),
  CONSTRAINT `tasks_requests_skills_fk` FOREIGN KEY (`skill_id`) REFERENCES `skills` (`id`),
  CONSTRAINT `tasks_requests_tasks_fk` FOREIGN KEY (`tsk_id`) REFERENCES `projects` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: teams
#

DROP TABLE IF EXISTS `teams`;

CREATE TABLE `teams` (
  `id` int(10) NOT NULL,
  `prjct_id` int(10) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `teams_project_fk` (`prjct_id`),
  CONSTRAINT `teams_project_fk` FOREIGN KEY (`prjct_id`) REFERENCES `projects` (`id`) ON DELETE CASCADE  
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `FirstName` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `LastName` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `Phone` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Phone` (`Phone`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


USE prteam;
